-- ----------------------------
-- Table structure for member
-- ----------------------------
DROP TABLE IF EXISTS `member`;
CREATE TABLE `member` (
  `member_id` int(11) NOT NULL AUTO_INCREMENT,
  `pid` int(11) DEFAULT NULL,
  `idfa` varchar(100) DEFAULT NULL COMMENT 'IDFA',
  `member_name` varchar(50) DEFAULT NULL COMMENT '会员名',
  `nickname` varchar(50) DEFAULT NULL COMMENT '昵称',
  `pic` varchar(255) DEFAULT NULL COMMENT '头像',
  `age` tinyint(4) DEFAULT NULL COMMENT '年龄',
  `sex` enum('1','2') NOT NULL DEFAULT '1' COMMENT '性别',
  `country` varchar(20) DEFAULT NULL COMMENT '国家',
  `city` varchar(20) DEFAULT NULL COMMENT '城市',
  `user_num` varchar(25) DEFAULT NULL COMMENT '会员编号',
  `phone` varchar(50) DEFAULT NULL COMMENT '电话',
  `openid` varchar(200) DEFAULT NULL COMMENT '用户的唯一标识',
  `income` float DEFAULT NULL COMMENT '总收入',
  `balance` float DEFAULT NULL COMMENT '账号余额',
  `status` tinyint(4) DEFAULT NULL,
  `source` varchar(100) DEFAULT NULL COMMENT '用户来源',
  `add_time` datetime DEFAULT NULL COMMENT '加入时间',
  `ip` varchar(32) DEFAULT NULL COMMENT '加入ip',
  `login_time` datetime DEFAULT NULL,
  `total_task` float DEFAULT NULL COMMENT '任务总收益',
  `total_invite` float DEFAULT NULL COMMENT '邀请总收益',
  `total_wd` float DEFAULT NULL COMMENT '提现总额',
  `finishs_task` varchar(100) DEFAULT NULL COMMENT '完成任务总数量',
  `invites` varchar(100) DEFAULT NULL COMMENT '邀请好友总数量',
  `invitee_sum` float DEFAULT NULL COMMENT '被邀请总金额',
  `birthday` datetime DEFAULT NULL COMMENT '出生日期',
  `qrcode` varchar(100) DEFAULT NULL COMMENT '二维码',
  `weixin` varchar(100) DEFAULT NULL COMMENT '微信号',
  `alipay` varchar(100) DEFAULT NULL COMMENT '支付宝',
  `yzm_code` varchar(7) DEFAULT NULL,
  `yzm_time` int(11) DEFAULT NULL COMMENT '验证时间',
  `subscribe` tinyint(4) NOT NULL DEFAULT '1' COMMENT '关注状态',
  `click_time` datetime DEFAULT NULL COMMENT '通知点击时间',
  `phone1` varchar(32) DEFAULT NULL COMMENT '备用电话',
  `addr` varchar(128) NOT NULL DEFAULT '' COMMENT '地址',
  `email` varchar(64) NOT NULL DEFAULT '' COMMENT '邮箱',
  `signature` varchar(128) NOT NULL DEFAULT '' COMMENT '签名',
  `hometown` varchar(128) DEFAULT NULL COMMENT '家乡',
  `bonus` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '红包',
  `comsum` float unsigned NOT NULL DEFAULT '0' COMMENT '佣金余额',
  `grandRechange` float(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '累计充值',
  `grandBuy` float(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '累计购买',
  `creatDate` bigint(20) unsigned NOT NULL COMMENT '注册时间',
  `last_login_time` int(11) unsigned NOT NULL COMMENT '上次登录时间',
  `login_remind_switch` tinyint(2) NOT NULL DEFAULT '0' COMMENT '登录提醒 0不提醒1提醒',
  `is_robot` tinyint(1) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`member_id`)
) ENGINE=MyISAM AUTO_INCREMENT=51 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of member
-- ----------------------------

