  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '权限编号',
  `name` varchar(32) NOT NULL COMMENT '权限名称',
  `pid` smallint(8) unsigned NOT NULL COMMENT '父id',
  `auth_c` varchar(32) NOT NULL DEFAULT '' COMMENT '控制器名',
