  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goodsId` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '商品ID',
  `numId` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '编号',
  `userId` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户编号',
  `type` tinyint(1) unsigned NOT NULL COMMENT '类型 2.包场 3.  0元购',
  `content` text NOT NULL COMMENT '内容',
