-- ----------------------------
-- Table structure for yytb_bbooking
-- ----------------------------
DROP TABLE IF EXISTS `yytb_bbooking`;
CREATE TABLE `yytb_bbooking` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '包场编号',
  `creater` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '发起者 (来自user.id)',
  `invite_code` varchar(64) DEFAULT NULL COMMENT '包场邀请码',
  `goods_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '被包场的商品 (来自goods.id)',
  `goods_title` varchar(128) NOT NULL DEFAULT '' COMMENT '商品标题',
  `goods_img` varchar(255) DEFAULT NULL COMMENT '商品图片',
  `goods_type` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '商品分类',
  `goods_price` float(11,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '商品价格',
  `goods_value` float(11,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '商品价值',
  `amount` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '总份数',
  `sales` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '销量',
  `create_time` bigint(20) NOT NULL DEFAULT '0' COMMENT '包场创建时间',
  `sellout_time` double(15,3) unsigned DEFAULT NULL COMMENT '售罄时间 三位小数为毫秒',
  `lottery_time` double(15,3) unsigned DEFAULT NULL COMMENT '开奖时间',
  `lottery_code` int(11) DEFAULT NULL COMMENT '开奖码',
  `get_time` int(11) DEFAULT NULL COMMENT '领奖时间',
  `exp_number` bigint(20) DEFAULT NULL COMMENT '发货编号',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '包场状态: 1-在售(默认), 2-倒计时, 3-开奖, 4已领取 ，5已晒单',
  `addr_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`),
  KEY `creater` (`creater`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='包场表';

-- ----------------------------
-- Records of yytb_bbooking
-- ----------------------------

-- ----------------------------
-- Table structure for yytb_bbooking_detail
-- ----------------------------
DROP TABLE IF EXISTS `yytb_bbooking_detail`;
CREATE TABLE `yytb_bbooking_detail` (
  `Id` int(11) NOT NULL AUTO_INCREMENT COMMENT '明细编号',
  `participator` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '参与用户(user.id)',
  `bbid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '包场编号(bbooking.id)',
  `bbcode` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '包场抽奖码',
  `create_time` double(15,3) unsigned NOT NULL DEFAULT '0.000' COMMENT '购买时间,含微秒',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态',
  PRIMARY KEY (`Id`),
  KEY `participator` (`participator`),
  KEY `bbid` (`bbid`),
  KEY `bbid_2` (`bbid`),
  KEY `participator_2` (`participator`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='包场明细表';

-- ----------------------------
-- Records of yytb_bbooking_detail
-- ----------------------------

