  `bbid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '包场编号(bbooking.id)',
  `tpin` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '有参与资格的人(user.id)',
  `status` int(11) unsigned NOT NULL DEFAULT '1' COMMENT '数据状态',
  `tpin.remark` varchar(32) DEFAULT NULL COMMENT '可参与者备注',
  PRIMARY KEY (`Id`)
