-- ----------------------------
-- Table structure for yytb_cheat
-- ----------------------------
DROP TABLE IF EXISTS `yytb_cheat`;
CREATE TABLE `yytb_cheat` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '商品编号 (来自商品表)',
  `start_time` int(11) unsigned NOT NULL DEFAULT '120' COMMENT '某一期多久后自动购买(分钟)',
  `last_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '上次购买时间(时间戳)',
  `interval_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '两次购买的间隔时间(秒钟)',
  `c_type` int(11) unsigned NOT NULL DEFAULT '1' COMMENT '1:普通云购  2:0元购',
  `k_type` int(11) unsigned NOT NULL DEFAULT '1' COMMENT '1:随机,2:机器人,3:用户',
  `switch` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '状态: 0,无效; 1,有效(默认);',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='作弊信息表';

-- ----------------------------
-- Records of yytb_cheat
-- ----------------------------

