  `goods_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '参与了自动购买的商品',
  `counter` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '参与自动购买的次数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

