-- ----------------------------
-- Table structure for yytb_goods
-- ----------------------------
DROP TABLE IF EXISTS `yytb_goods`;
CREATE TABLE `yytb_goods` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '商品编号',
  `title` varchar(64) NOT NULL COMMENT '标题',
  `typeId` int(10) NOT NULL COMMENT '分类 id',
  `taxis` int(10) NOT NULL COMMENT '排序',
  `description` varchar(256) NOT NULL COMMENT '简介',
  `content` longtext NOT NULL COMMENT '图文详情',
  `image` varchar(128) NOT NULL COMMENT '主图',
  `originPrice` float(10,2) NOT NULL COMMENT '原价',
  `price` float NOT NULL COMMENT '上架价格',
  `qishu` int(10) NOT NULL COMMENT '当前期数',
  `fenshu` int(10) NOT NULL COMMENT '份数',
  `canyushu` int(10) NOT NULL COMMENT '已售份数',
  `updateDate` bigint(20) NOT NULL COMMENT '更新时间',
  `creatDate` bigint(20) NOT NULL COMMENT '创建时间',
  `maxqishu` int(10) NOT NULL COMMENT '最大期数',
  `lock_version` varchar(128) NOT NULL,
  `status` varchar(10) NOT NULL COMMENT '状态 0-关闭 1-在售 2-开奖中 3-已售完',
  `goods_popular` int(11) NOT NULL DEFAULT '0' COMMENT '人气',
  `limit_buy` int(10) NOT NULL DEFAULT '0' COMMENT '限制最大购买数量，0为不限制',
  `recommend` int(10) DEFAULT '1',
  `rstatus` tinyint(2) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8 COMMENT='商品表';

