  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '云购类别编号',
  `typeName` varchar(32) NOT NULL COMMENT '类别名称',
  `url` varchar(128) NOT NULL COMMENT 'ICON',
  `url_main` varchar(128) NOT NULL DEFAULT '' COMMENT '首页专区的图片地址',
  `description` varchar(128) NOT NULL COMMENT '描述',
