-- ----------------------------
-- Table structure for yytb_menu
-- ----------------------------
DROP TABLE IF EXISTS `yytb_menu`;
CREATE TABLE `yytb_menu` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `pid` varchar(64) NOT NULL COMMENT '父级 ID',
  `type` varchar(32) NOT NULL COMMENT '菜单类型  如: home',
  `name` varchar(64) NOT NULL COMMENT '名称',
  `url` varchar(128) NOT NULL COMMENT '模块/控制器/操作',
  `params` varchar(128) NOT NULL COMMENT '参数 如: id=1',
  `icon` varchar(128) NOT NULL COMMENT 'class',
  `taxis` int(10) NOT NULL COMMENT '排序',
  `creatDate` bigint(20) NOT NULL COMMENT '创建时间',
  `status` tinyint(4) NOT NULL COMMENT '状态 0-隐藏 1-显示',
