) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COMMENT='菜单设置';

-- ----------------------------
-- Records of yytb_menu
-- ----------------------------

-- ----------------------------
-- Table structure for yytb_msg
-- ----------------------------
DROP TABLE IF EXISTS `yytb_msg`;
CREATE TABLE `yytb_msg` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `title` varchar(64) NOT NULL COMMENT '标题',
  `content` varchar(256) NOT NULL COMMENT '内容',
  `type` varchar(16) NOT NULL COMMENT '类型 goods:普通商品;  goods0:零元购;  goods1:包场中奖;  room:包场邀请;  express:发货;  friend:好友申请;',
  `action` varchar(128) NOT NULL COMMENT '操作  例如: Api/Goods/show',
  `param` varchar(32) NOT NULL COMMENT '参数  例如: id=2&name=ja',
  `create_time` int(10) NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8 COMMENT='站内消息';

-- ----------------------------
-- Records of yytb_msg
-- ----------------------------

-- ----------------------------
-- Table structure for yytb_msg_list
-- ----------------------------
DROP TABLE IF EXISTS `yytb_msg_list`;
CREATE TABLE `yytb_msg_list` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `send_to` int(10) NOT NULL COMMENT '用户 ID',
  `send_type` int(10) NOT NULL DEFAULT '1' COMMENT '1 短信   2 微信 [3 邮件]    判断方法 send_type & pow(2, x) = pow(2, x)',
  `send_time` int(10) NOT NULL DEFAULT '0' COMMENT '发送时间',
  `is_send` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0 未发送  1 已发送',
  `content` varchar(256) NOT NULL COMMENT '消息内容',
  `url` varchar(128) NOT NULL COMMENT '网址',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='消息列表';

-- ----------------------------
-- Records of yytb_msg_list
-- ----------------------------

-- ----------------------------
-- Table structure for yytb_msg_map
-- ----------------------------
DROP TABLE IF EXISTS `yytb_msg_map`;
CREATE TABLE `yytb_msg_map` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `msg_id` int(10) NOT NULL COMMENT '消息 id',
  `user_id` int(10) NOT NULL DEFAULT '0' COMMENT '用户 id',
  `show_time` int(10) NOT NULL COMMENT '显示时间， 大于此时间用户可见',
  `is_read` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否阅读',
  `read_time` int(10) NOT NULL DEFAULT '0' COMMENT '阅读时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8 COMMENT='站内消息 链接表';

-- ----------------------------
-- Records of yytb_msg_map
-- ----------------------------

-- ----------------------------
-- Table structure for yytb_msg_pbz
-- ----------------------------
DROP TABLE IF EXISTS `yytb_msg_pbz`;
CREATE TABLE `yytb_msg_pbz` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pbz_id` int(11) NOT NULL COMMENT '购物信息id',
  `msg_id` int(11) NOT NULL COMMENT 'msg_queue表id',
  `type` int(11) NOT NULL COMMENT '普通,1; 包场,2; 零元购,3',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=49 DEFAULT CHARSET=utf8 COMMENT='消息标识表';

-- ----------------------------
-- Records of yytb_msg_pbz
-- ----------------------------

-- ----------------------------
-- Table structure for yytb_msg_queue
-- ----------------------------
DROP TABLE IF EXISTS `yytb_msg_queue`;
CREATE TABLE `yytb_msg_queue` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` smallint(6) unsigned NOT NULL DEFAULT '1' COMMENT '消息类型:1,微信消息;2,短信;...',
  `go_url` varchar(256) DEFAULT NULL COMMENT '微信消息的跳转地址(可空)',
  `send_time` bigint(3) unsigned NOT NULL DEFAULT '0' COMMENT '何时发送',
  `send_to` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '发送给谁(用户编号)',
  `content` text NOT NULL COMMENT '消息内容',
  `sended` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否发送(0,否;1,是)',
  `create_time` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8 COMMENT='待发送的消息队列';

-- ----------------------------
-- Records of yytb_msg_queue
-- ----------------------------

