-- Table structure for yytb_nav
-- ----------------------------
DROP TABLE IF EXISTS `yytb_nav`;
CREATE TABLE `yytb_nav` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `cid` varchar(64) NOT NULL COMMENT '内容 id',
  `type` varchar(32) NOT NULL COMMENT 'id 类型',
  `icon` varchar(128) NOT NULL COMMENT '图标地址',
  `taxis` int(10) NOT NULL COMMENT '排序',
  `creatDate` bigint(20) NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='首页导航';

-- ----------------------------
-- Records of yytb_nav
-- ----------------------------

-- ----------------------------
-- Table structure for yytb_order
-- ----------------------------
DROP TABLE IF EXISTS `yytb_order`;
CREATE TABLE `yytb_order` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `order_code` char(32) NOT NULL DEFAULT '' COMMENT '订单编号',
  `creat_date` double(15,3) NOT NULL DEFAULT '0.000' COMMENT '创建时间',
  `user_id` int(10) NOT NULL DEFAULT '0' COMMENT '用户编号',
  `cost` float(6,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '金额',
  `pay_method` char(32) NOT NULL DEFAULT '' COMMENT '支付方式 ( 微信支付 : weixin ; 微信APP : weixin_app ; 电脑端微信支付 : weixin_pc ; 余额支付 : balance ;电脑端微信支付+余额支付：weixin_balance )',
  `order_status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '付款状态 ( 0:未付款 ; 1已付款)',
  `order_type` tinyint(2) NOT NULL DEFAULT '0' COMMENT '订单类型(默认0云购,1网络充值)',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '订单状态  1,启用;2关闭',
  `app_log` varchar(50) NOT NULL DEFAULT '1' COMMENT 'APP 附加字段',
  `area` varchar(64) DEFAULT NULL COMMENT 'IP 归属地',
  `ip` varchar(15) DEFAULT NULL COMMENT 'IP 地址',
  PRIMARY KEY (`id`),
  KEY `order_code` (`order_code`)
) ENGINE=MyISAM AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='云购订单表';

-- ----------------------------
-- Records of yytb_order
-- ----------------------------

-- ----------------------------
-- Table structure for yytb_order_detail
-- ----------------------------
DROP TABLE IF EXISTS `yytb_order_detail`;
CREATE TABLE `yytb_order_detail` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `order_code` char(32) NOT NULL DEFAULT '' COMMENT '云购订单编号',
  `user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '用户编号',
  `goods_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '商品 id',
  `bbid` int(11) unsigned DEFAULT NULL COMMENT '包场id',
  `pid` int(10) unsigned NOT NULL COMMENT '云购表ID',
  `title` varchar(64) NOT NULL DEFAULT '' COMMENT '下单时的商品标题',
  `image` varchar(255) NOT NULL DEFAULT '' COMMENT '下单时的商品主图',
  `price` float(8,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '下单时商品价格',
  `nums` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '下单时商品数量',
  `qishu` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '下单时的期数',
  `express_no` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '快递单号',
  `express_com` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '快递公司',
  `name` varchar(32) NOT NULL DEFAULT '' COMMENT '收件人',
  `addr` varchar(255) NOT NULL DEFAULT '' COMMENT '收件地址',
  `phone` char(11) NOT NULL DEFAULT '' COMMENT '收件人手机号',
  `send_date` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '发货时间',
  `receive_date` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '收货时间',
  `status` varchar(10) NOT NULL DEFAULT '1' COMMENT '状态 1启用,2禁用',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`,`goods_id`,`qishu`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COMMENT='发货记录表';

-- ----------------------------
-- Records of yytb_order_detail
-- ----------------------------

