  `userId` int(10) NOT NULL COMMENT '用户编号',
  `cost` float(6,2) NOT NULL COMMENT '金额',
  `status` varchar(10) NOT NULL COMMENT '订单状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='云购订单表';

