DROP TABLE IF EXISTS `yytb_pay_card`;
CREATE TABLE `yytb_pay_card` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `payCardNum` char(12) NOT NULL COMMENT '充值卡号',
  `pass` char(8) NOT NULL COMMENT '充值卡密码',
  `payCardSize` int(11) NOT NULL COMMENT '充值卡面额',
  `overdueDate` bigint(20) NOT NULL COMMENT '过期时间--时间戳',
  `payDate` bigint(20) NOT NULL DEFAULT '0' COMMENT '充值时间--时间戳',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '可用状态1可用,0不可用',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=61 DEFAULT CHARSET=utf8;

