CREATE TABLE `yytb_pcode` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `pid` int(10) DEFAULT NULL,
  `pcode` int(10) DEFAULT NULL,
  `status` int(8) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=gbk;

-- ----------------------------
-- Records of yytb_pcode
