-- ----------------------------
-- Table structure for yytb_periods
-- ----------------------------
DROP TABLE IF EXISTS `yytb_periods`;
CREATE TABLE `yytb_periods` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '云购编号',
  `goodsId` int(10) NOT NULL COMMENT '商品编号',
  `title` varchar(64) NOT NULL COMMENT '商品标题',
  `type` int(10) NOT NULL COMMENT '分类',
  `price` float(6,2) NOT NULL COMMENT '上架价格',
  `total` float(6,2) NOT NULL COMMENT '商品总价',
  `qishu` int(10) NOT NULL COMMENT '期数',
  `fenshu` int(10) NOT NULL COMMENT '总份数',
  `canyushu` int(10) NOT NULL COMMENT '已参与份数',
  `creatDate` bigint(20) NOT NULL COMMENT '创建时间',
  `creatMicrotime` double(15,3) NOT NULL COMMENT '售完时间 小数位毫秒',
  `discloseDate` bigint(20) NOT NULL COMMENT '开奖时间',
  `winningCode` int(10) NOT NULL COMMENT '中奖码',
  `winUserId` int(10) NOT NULL COMMENT '中奖用户编号',
  `getDate` int(10) NOT NULL COMMENT '领奖时间',
  `sendId` bigint(20) NOT NULL COMMENT '发货编号',
  `status` varchar(10) NOT NULL COMMENT '云购状态 1-开奖 2-倒计时 3-在售中',
  `image` varchar(128) NOT NULL DEFAULT '' COMMENT '云购时的商品图片',
  `flag` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT '中奖领取状态1未领取 0已领取 2已发货 3已收货 4已晒单',
  `area` varchar(50) NOT NULL DEFAULT '' COMMENT 'IP 归属地',
  `ip` varchar(15) NOT NULL DEFAULT '' COMMENT 'IP',
  `ssc_expect` bigint(11) DEFAULT NULL,
  `ssc_code` int(11) DEFAULT NULL,
  `constantly` int(6) unsigned DEFAULT '0' COMMENT '时时彩开奖码',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=utf8 COMMENT='云购表';

-- ----------------------------
-- Records of yytb_periods
-- ----------------------------

