  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '云购明细编号',
  `userId` int(10) NOT NULL COMMENT '用户编号',
  `goodsId` int(10) NOT NULL COMMENT '商品编号',
  `qishu` int(10) NOT NULL COMMENT '期数',
  `pcode` int(10) NOT NULL COMMENT '云购码',
  `status` varchar(10) NOT NULL COMMENT '状态',
  `creatDate` bigint(20) NOT NULL COMMENT '创建时间',
  `microtime` double(15,3) DEFAULT NULL COMMENT '时间戳含微秒',
  `periods_id` int(11) NOT NULL DEFAULT '0' COMMENT '云购表id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1134 DEFAULT CHARSET=utf8 COMMENT='云购明细表';

