  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `goodsId` int(10) NOT NULL COMMENT '商品编号',
  `pid` int(10) NOT NULL COMMENT '云购编号',
  `userId` int(10) NOT NULL COMMENT '用户编号',
  `content` longtext NOT NULL COMMENT '内容',
  `pic1` varchar(128) NOT NULL COMMENT '图片1',
  `pic2` varchar(128) NOT NULL COMMENT '图片2',
  `pic3` varchar(128) NOT NULL COMMENT '图片3',
  `creatDate` bigint(20) NOT NULL COMMENT '发表时间',
  `status` varchar(10) NOT NULL COMMENT '状态',
  `title` varchar(128) NOT NULL COMMENT '标题',
  `popular` int(11) DEFAULT NULL COMMENT '人气',
  `essence` int(11) DEFAULT NULL COMMENT '精华',
  `recommend` int(11) DEFAULT NULL COMMENT '推荐',
  PRIMARY KEY (`id`)
