-- ----------------------------
-- Table structure for yytb_user
-- ----------------------------
DROP TABLE IF EXISTS `yytb_user`;
CREATE TABLE `yytb_user` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `nickName` varchar(32) NOT NULL COMMENT '昵称',
  `facePic` varchar(128) NOT NULL COMMENT '头像',
  `phone` varchar(32) NOT NULL COMMENT '电话',
  `addr` varchar(128) NOT NULL COMMENT '地址',
  `password` varchar(32) NOT NULL COMMENT '密码',
  `signature` varchar(128) NOT NULL COMMENT '签名',
  `email` varchar(64) NOT NULL COMMENT '邮箱',
  `balance` float(9,2) NOT NULL COMMENT '余额',
  `bonus` int(10) NOT NULL COMMENT '红包',
  `grandRechange` float(10,2) NOT NULL COMMENT '累计充值',
  `grandBuy` float(10,2) NOT NULL COMMENT '累计购买',
  `creatDate` bigint(20) NOT NULL COMMENT '注册时间',
  `status` varchar(10) NOT NULL COMMENT '状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of yytb_user
-- ----------------------------

-- ----------------------------
-- Table structure for yytb_user_addr
-- ----------------------------
DROP TABLE IF EXISTS `yytb_user_addr`;
CREATE TABLE `yytb_user_addr` (
  `addr_id` int(10) NOT NULL AUTO_INCREMENT COMMENT '地址 id',
  `userId` int(10) NOT NULL COMMENT '用户 id',
  `phone` varchar(32) NOT NULL COMMENT '联系电话',
  `name` varchar(32) CHARACTER SET utf8 NOT NULL COMMENT '收件人电话',
  `addr` varchar(256) CHARACTER SET utf8 NOT NULL COMMENT '联系地址',
  `more` varchar(256) CHARACTER SET utf8 NOT NULL COMMENT '备注',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '状态 1-默认地址',
  PRIMARY KEY (`addr_id`)
) ENGINE=MyISAM AUTO_INCREMENT=18 DEFAULT CHARSET=gbk COMMENT='收件地址保存表';

-- ----------------------------
-- Records of yytb_user_addr
-- ----------------------------

-- ----------------------------
-- Table structure for yytb_user_detail
-- ----------------------------
DROP TABLE IF EXISTS `yytb_user_detail`;
CREATE TABLE `yytb_user_detail` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `userId` int(10) NOT NULL COMMENT '用户编号',
  `name` varchar(32) NOT NULL COMMENT '项目',
  `val` varchar(128) NOT NULL COMMENT '值',
  `creatDate` bigint(20) NOT NULL COMMENT '更新时间',
  `consume` float DEFAULT '0' COMMENT '消费金额(默认0)',
  `comval` float DEFAULT '0' COMMENT '全城积分值(默认0)',
  `rpUserId` int(10) DEFAULT NULL COMMENT '邀请人ID',
  `invite_num` varchar(50) DEFAULT '' COMMENT '身份识别码',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='用户明细表';

-- ----------------------------
-- Records of yytb_user_detail
-- ----------------------------

-- ----------------------------
-- Table structure for yytb_user_fast_login
-- ----------------------------
DROP TABLE IF EXISTS `yytb_user_fast_login`;
CREATE TABLE `yytb_user_fast_login` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` varchar(128) NOT NULL DEFAULT '' COMMENT '用户编号',
  `fast_login_id` varchar(128) DEFAULT '' COMMENT '快捷登录码',
  `type` tinyint(3) unsigned NOT NULL COMMENT '登录类型:1,微信;2,QQ;',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态:0,禁用;1,启用',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_id` (`user_id`),
  UNIQUE KEY `loginid` (`fast_login_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='用户快捷登录信息';

-- ----------------------------
-- Records of yytb_user_fast_login
-- ----------------------------

-- ----------------------------
-- Table structure for yytb_user_friends
-- ----------------------------
DROP TABLE IF EXISTS `yytb_user_friends`;
CREATE TABLE `yytb_user_friends` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键自增',
  `friendsId` int(11) NOT NULL DEFAULT '0' COMMENT '用户的朋友',
  `partiesId` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `anchorLink` char(2) NOT NULL COMMENT '锚链接#,A,B,....,X,Y,Z',
  `remarks` varchar(32) NOT NULL COMMENT '备注名',
  `addDate` bigint(20) NOT NULL COMMENT '添加日期时间戳',
  `isSee` tinyint(4) unsigned NOT NULL COMMENT '标志位---1代表未查看,0代表已查看',
  `flag` tinyint(4) NOT NULL COMMENT '标志位---1代表已同意,0代表未同意',
  `is_msg` int(11) DEFAULT '0' COMMENT '标志位---0代表需要提醒,1代表不需要提醒',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=gbk COMMENT='用户好友表';

-- ----------------------------
-- Records of yytb_user_friends
-- ----------------------------

-- ----------------------------
-- Table structure for yytb_user_map
-- ----------------------------
DROP TABLE IF EXISTS `yytb_user_map`;
CREATE TABLE `yytb_user_map` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '购买记录编号',
  `pid` int(10) NOT NULL COMMENT '云购表编号',
  `userId` int(10) NOT NULL COMMENT '用户 ID',
  `goodsId` int(10) NOT NULL COMMENT '商品编号',
  `qishu` int(10) NOT NULL COMMENT '期数',
  `num` int(11) NOT NULL COMMENT '总数量',
  `updateDate` bigint(20) NOT NULL COMMENT '更新时间',
  `status` int(10) NOT NULL COMMENT '云购状态 1-开奖 2-倒计时 3-在售中',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=157 DEFAULT CHARSET=gbk COMMENT='用户 云购连接表';

